        "color": 7,
        "width": 280.2462120317618,
        "height": 438.5821431288714,
        "content": "#### 场景一：使用AssemblyAI转录通话  \n1. **配置请求**：  \n   - **请求头认证**：在`Authorization`中填入AssemblyAI的API密钥。  \n   - **请求地址**：向`https://api.assemblyai.com/v2/transcript/`发送POST请求。  \n   - **参数**：  \n     - `audio_url`：音频文件的直链URL。  \n     - `webhook_url`：用于接收转录结果的N8N webhook地址。  \n     - **高级设置**：  \n       - `speaker_labels`（true/false）：启用说话人分离功能。  \n       - `speakers_expected`：指定预期的说话人数量。  \n       - `language_code`：设置语言（默认值：`en_us`）。  \n\n#### 场景二：通过OpenAI处理转录文本  \n1. **配置Webhook**：设置一个POST webhook以接收AssemblyAI的转录数据。  \n2. **获取转录文本**：  \n   - **请求头认证**：在`Authorization`中填入AssemblyAI的API密钥。  \n   - **请求地址**：GET请求`https://api.assemblyai.com/v2/transcript/<transcript_id>`。  \n3. **发送至OpenAI**：  \n   - **请求地址**：向`https://api.openai.com/v1/chat/completions`发送POST请求。  \n   - **请求头认证**：在`Authorization`中填入OpenAI的API密钥。  \n   - **请求体参数**：  \n     - **模型选择**：支持JSON Schema时使用`gpt-4o-2024-08-06`，或选用成本更低的`gpt-4o-mini`。  \n     - **消息内容**：  \n       - `system`：包含核心分析指令。  \n       - `user`：待分析的说话人合并文本（纯文字格式）。  \n     - **响应格式**：  \n       - `type`：设为`json_schema`。  \n       - `json_schema`：定义结构化响应的JSON模板。  \n\n4. **存储结果至Supabase**：  \n   - **操作类型**：新增记录。  \n   - **数据表名**：`demo_calls`。  \n   - **字段内容**：  \n     - **输入数据**：转录文本、音频URL、转录ID。  \n     - **输出数据**：OpenAI分析后的结构化JSON响应。"
      },
