        "width": 636.2128494576581,
        "height": 598.6675280064023,
        "content": "![5min Logo](https://cflobdhpqwnoisuctsoc.supabase.co/storage/v1/object/public/my_storage/Untitled%20(1500%20x%20300%20px).png)\n## 集成AssemblyAI转录与OpenAI助手的通话分析系统\n**由[5minAI社区](https://www.skool.com/5minai-2861)的[Mark Shcherbakov](https://www.linkedin.com/in/marklowcoding/)开发**\n\n多数销售跟进电话缺乏结构化分析，导致难以识别客户需求、评估兴趣程度或发现增销机会。本工作流通过自动通话转录和AI驱动分析生成可执行洞察，帮助团队提升销售表现、优化客户沟通并简化增销策略。\n\n该工作流利用AssemblyAI、OpenAI和Supabase实现销售通话的转录分析与结构化存储，处理流程如下：\n\n1. **AssemblyAI通话转录**：将音频转换为带说话人标签的清晰文本\n2. **OpenAI转录分析**：根据预设JSON模板提取客户意向、兴趣指数、增销机会等关键指标\n3. **Supabase数据存储**：将转录文本与分析结果存入数据库，供后续调取及界面展示"
